import "./App.css";
import { Button, Nav, Navbar } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">
      <Navbar bg="orange" sticky="top">
        <Navbar.Brand href="#home">the salad bowl</Navbar.Brand>
        <Nav>
          <Nav.Link href="#home">our story</Nav.Link>
          <Nav.Link href="#order">order online</Nav.Link>
          <Nav.Link href="#contact">contact us</Nav.Link>
        </Nav>
      </Navbar>
      <Button>Hello World</Button>
    </div>
  );
}

export default App;
